import React from "react";
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';

const Footer = styled(Box)(() => ({
    backgroundColor: '#000000',
    color: '#ffffff',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
}));

export default function mainFooter() {

    return (
        <Footer>
            <p>2023</p>
        </Footer>
    )
}
